      </div>
      <div className="footerAuthor">
        <span> {props.footerContent[0]} </span> <br />
        <span> {props.footerContent[1]} </span> <br />
        <span> {props.footerContent[2]} </span>{" "}
      </div>
    </div>
  );
}
